import React from "react";
import Logo from "../img/whitelogo.png";
function Footer() {
  return (
    <footer className="footer">
      <div className="container">
        <div className="row">
          <div className="col">
            <div class="block">
              <figure></figure>
              <h1 class="title">the title here</h1>
              <p class="excerpt">the text goes here</p>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
